x-deeplearning::::blaze/serving/thirdparty/libevent/.travis.yml::::before_install::::if [ "$TRAVIS_OS_NAME" == "osx" ]; then if [ "$CC" == "gcc" ]; then export CC=$(ls -t /usr/local/bin/gcc-?.?); fi
export OPENSSL_ROOT=$(echo /usr/local/Cellar/openssl/*); export CMAKE_INCLUDE_PATH=$OPENSSL_ROOT/include CMAKE_LIBRARY_PATH=$OPENSSL_ROOT/lib; export CFLAGS=-I$CMAKE_INCLUDE_PATH LDFLAGS=-L$CMAKE_LIBRARY_PATH;
export JOBS=1; fi
